import React, { useState } from "react";
import "./App.css";
import male from "./photos/Mars_symbol.svg.png";
import female from "./photos/Venus_symbol.svg.png";
import back from "./photos/back button.png";
function App() {
  const [gender, genderFunction] = useState("");
  return (
    <React.Fragment>
      <img src={back} className="back" height="28px" onClick={()=>{console.log('pre page')}} />
      <h2 className="text-center  my-3">I am a ..</h2>
      <div className="container">
        <div className="row">
          <div className="col-sm">
            <div className="card text-center">
              <div
                className="overflow"
                onClick={() => {
                  genderFunction("Male");
                }}
              >
                <img src={male} height="187px" />
              </div>
              <div className="card-body text-dark">Male</div>
            </div>
          </div>
          <div className="col-sm">
            <div className="card text-center">
              <div
                className="overflow"
                onClick={() => {
                  genderFunction("Female");
                }}
              >
                <img src={female} />
              </div>
              <div className="'card-body text-dark">Female</div>
            </div>
          </div>
        </div>
      </div>
      <br />
      <div className="App">
        <button
          className="btn btn-pink "
          onClick={gender === 'Female' || 'Male' ?() => {
            console.log(gender);
          }:()=>{console.log('Did not choose')}}
        >
          &emsp;&emsp; Next &emsp;&emsp;{" "}
        </button>
      </div>
    </React.Fragment>
  );
}

export default App;
